import React from 'react';
import './Multiplier.css';

const Multiplier = ({ multiplier, x, onHit }) => {
  return (
    <div
      className="multiplier"
      style={{ left: `${x}px`, bottom: '10px' }}
      onClick={onHit}
    >
      x{multiplier}
    </div>
  );
};

export default Multiplier;
